import React, {Component} from 'react'
import './nav.css'
import {Link} from 'react-router-dom'
import axios from 'axios'
import Swal from 'sweetalert2'
import {updateUser} from '../../ducks/reducer'

export default class Nav extends Component {
    constructor() {
        super()
        this.state = {

        }
    }
    logout = async () => {
        const res = await axios.delete('/auth/logout')
        updateUser(null)
        Swal.fire({type: 'success', text: res.data.message })
    }
    render() {
        return(
        <div className='nav'>
            
            <div className='upper'>
            <img className="icons" src="data:image/jpeg;base64," alt="a house"/>
            <img className="icons" src="data:image/jpeg;base64," alt="add page"/>
            </div>
            <div className="lower">
            <Link to='/'>
                {/* <button onClick={() => this.logout()}>logot</button> */}
                <img 
            onClick={() => this.logout()}
            className="icons" src="data:image/jpeg;base64," alt="logout"/>
            </Link>
            </div>

        </div>
        )
    }
}
